import React from 'react';
import logo from './logo.svg';
import './App.css';




async function get_tweets() {
  let result = await (await fetch('http://127.0.0.1:5000/tweets')).json();
  // let json = await result.json()
  return result;
}


function App() {
  var questions =  fetch('http://127.0.0.1:5000/tweets').then(res => res.json()).then(x => console.log(x))
  return (
    <div >
      {questions}
    </div>
  );
}

export default App;
